import React, { useState } from "react";
import { questions } from "./App";
import "./index.css";
import myAccordion from "./myAccordion";

const Accordion = () => {

    const [data, setData] = useState(questions);

    return (
        <>
            {
                data.map((curElem) => {
                    const { id } = curElem;
                    return <myAccordion key={id} {...curElem} />
                })
            }
        </>
    );
};

export default Accordion;
